import React from 'react';

function StockList({stocks}){
	return (
   <ol className="stocklist-content"> 
    {
    stocks.map((stockname,index)=>{
      return  <li key={index}>
              <span>{stockname}</span>
      </li>
    })
    }
    </ol>
	);
};

export default StockList;
